        public Int32 Get(Tone tone)
        {
            return Get(tone.Group, tone.Category, tone.Name);
        }

        public Int32 Get(String Group, String Category, String Name)
        {
            Int32 i = 0;
            try
            {
                Name = Name.Trim();
                while (i < Tones.Count && (Tones[i][0] != Group || Tones[i][1] != Category || Tones[i][3] != Name)) i++;
                if (i >= Tones.Count)
                {
                    i = 0;
                    while (i < Tones.Count && (Tones[i][0] != Group || Tones[i][3] != Name)) i++;
                    if (i >= Tones.Count)
                    {
                        i = -1;
                    }
                }
            }
            catch
            {
                i = -1;
            }
            return i;
        }

        public Int32 Get(byte msb, byte lsb, byte pc)
        {
            Int32 i = 0;
            try
            {
                while (i < Tones.Count && (Tones[i][4] != msb.ToString() || Tones[i][5] != lsb.ToString() || Tones[i][7] != (pc + 1).ToString())) i++;
            }
            catch
            {
                i = -1;
            }
            return i;
        }
    }
